import React from 'react';

export default function Car(props) {
  const { cars, onAdd } = props;
  return (
    <div>
      <img className="small" src={cars.image} alt={cars.name} />
      <h3>{cars.name}</h3>
      <div>${cars.price}</div>
      <div>
        <button onClick={() => onAdd(cars)}>Add To Cart</button>
      </div>
    </div>
  );
}
